import React from 'react';
import {makeStyles, Tabs, Tab, Typography, Box, Container, Grid} from '@material-ui/core'
import { useHistory } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
      backgroundColor: "blue",
      display: 'flex',
      height: 224,
    },
}));


function Nav(){
    const classes = useStyles;
    return(
        <Grid
            container
            direction="column"
            justifyContent="flex-start"
            alignItems="flex-start">
            <h1>fdsa</h1>
        </Grid>
    );
}

export default Nav;
